sys_variable_value.value:
(function execute(inputs, outputs) {
    var dataJSON = JSON.parse(inputs.response_body);
    var obj = dataJSON.rows;

    var glideRecord = new GlideRecord("x_ebh_bill_report_branch_workato_snowflake_staging");

    for (var i = 0; i < obj.length ; i++) {
        glideRecord.initialize();
        glideRecord.branch_id = obj[i].branchid;
   		glideRecord.branch_name = obj[i].branch_name;
      glideRecord.branch_last_modified = obj[i].branch_last_modified;
      glideRecord.address_line_1 = obj[i].address_line_1;
      glideRecord.address_line_2= obj[i].address_line_1;
      glideRecord.area_last_modified=obj[i].area_last_modified;
      glideRecord.finance_division_last_modified=obj[i].finance_division_last_modified;
      glideRecord.region_last_modified=obj[i].region_last_modified;
      glideRecord.region=obj[i].region;
      glideRecord.address_city=obj[i].address_city;
      glideRecord.address_zip=obj[i].address_zip;
      glideRecord.branch_last_modified=obj[i].branch_last_modified;
      glideRecord.crm_brand=obj[i].crm_brand;
      glideRecord.cda_futa=obj[i].cda_futa;
      glideRecord.cda_suta=obj[i].cda_suta;
      glideRecord.accounting_unit=obj[i].accounting_unit;
      glideRecord.finance_division=obj[i].finance_division;
      glideRecord.area_name=obj[i].area_name;
      glideRecord.branch_number=obj[i].branch_number;
      glideRecord.branch_active=obj[i].branch_active;
      glideRecord.cda_wcmodifier=obj[i].cda_wcmodifier
      glideRecord.fica=obj[i].fica;
      glideRecord.medi=obj[i].medi;


        glideRecord.insert();

    }
   outputs.output_data = obj.length;
  // outputs.response_data = JSON.stringify(dataJSON);
})(inputs, outputs);

